import logo from '../asserts/images/logo.svg'
import main from '../asserts/images/main.svg'
// import React from 'react'

const Landing = () => {
  return (
    <main>
        <img src={logo} alt='Brand logo' className='logo'/>
    </main>
  )
}

export default Landing
